export interface ICard {
  imgUrl: string;
  title: string;
  id: number;
}

const url = "https://i1.sndcdn.com/artworks-000635780677-yhmbpw-t500x500.jpg";

export const Cards: ICard[] = [
  { imgUrl: url, title: "Для авто", id: 1 },
  { imgUrl: url, title: "Здоровье", id: 2 },
  { imgUrl: url, title: "Развлечения", id: 3 },
  { imgUrl: url, title: "Бьюти", id: 4 },
  { imgUrl: url, title: "Ремонт", id: 5 },
  { imgUrl: url, title: "Услуги", id: 6 },
  { imgUrl: url, title: "Торговля", id: 7 },
  { imgUrl: url, title: "Образование", id: 8 },
  { imgUrl: url, title: "Продукты", id: 9 },
  { imgUrl: url, title: "Туризм", id: 10 },
  { imgUrl: url, title: "Связь", id: 11 },
  { imgUrl: url, title: "Товары", id: 12 },
];
